import React from "react";
import "./App.css";
import logo from "./final-inkling-logo.png";
import { Grid } from "semantic-ui-react";
import About from "./About";
import Code from "./Code";
import NavBar from "./NavBar";
import "bootstrap/dist/css/bootstrap.min.css";

// import { Navbar, Nav } from "react-bootstrap";

function App() {
  return (
    <div className="App">
      <NavBar></NavBar>
      <Grid divided="vertically">
        <Grid.Row columns={2}>
          <Grid.Column>
            <h2 id="welcome">Welcome to Inkling.</h2> <h2>Let's get coding!</h2>
          </Grid.Column>
          <Grid.Column>
            <img className="logo" src={logo}></img>
            {/* <h2>Welcome to Inkling. Let's get coding!</h2> */}
          </Grid.Column>
        </Grid.Row>
      </Grid>
      <img className="logo" src={logo}></img>
      <About></About>
      <Code></Code>
    </div>
  );
}

export default App;
